const Info = () => (
  <div className="absolute  h-screen w-screen bg-gradient-to-b from-primary">
    <div className="title text-center mt-s6 text-orange">The Curious Fox </div>
    <div className="text-center p-s1 text-blue">
      это современный центр дополнительного образования. Здесь школьники и
      взрослые могут изучать английский, немецкий, испанский и русский языки.
      Так же мы предлагаем занятия с ребятами дошкольного возраста по подготовке
      к школе.
    </div>
  </div>
);

export default Info;
